import React, { useState, useEffect } from "react";
import api from "./api";

const App = () => {
  const [moodpoints, setMoodpoints] = useState([]);
  const [formData, setFormData] = useState({
    label: "",
    energy: null,
    pleasantness: null,
  });

  const fetchMoodpoints = async () => {
    const response = await api.get("/moodpoints/");
    setMoodpoints(response.data);
  };

  useEffect(() => {
    fetchMoodpoints();
  }, []);

  const handleInputChange = (e) => {
    const value =
      e.target.type === "checkbox" ? e.targe.checked : e.target.value;
    setFormData({
      ...formData,
      [e.target.name]: value,
    });
  };

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    await api.post("/moodpoints/", formData);
    fetchMoodpoints();
    setFormData({
      label: "",
      energy: null,
      pleasantness: null,
    });
  };

  return (
    <div>
      <nav className='navbar navbar-dark bg-primary'>
        <div className="container-fluid">
          <a className='navbar-brand' href='#'>
            Moodtracker
          </a>
        </div>
      </nav>
    </div>
  )
};

export default App;
